-- drop user CMS_USER_ADMIN cascade;

--------------------------------------------------------
ALTER SESSION SET CURRENT_SCHEMA = NOTIFICATION;

BEGIN
  FOR rec IN (
    SELECT owner, table_name, constraint_name
    FROM all_constraints
    WHERE constraint_type = 'R' 
      AND owner = 'NOTIFICATION'  -- or use a specific schema name
  )
  LOOP
    EXECUTE IMMEDIATE 'ALTER TABLE ' || rec.owner || '.' || rec.table_name ||
                      ' DISABLE CONSTRAINT ' || rec.constraint_name;
  END LOOP;
END;
/

